import axios from "axios";

const languages = ["JavaScript", "Python", "C", "Ruby", "Java", "PHP", "C#"];
// Export an object containing methods we'll use for accessing the random user API
export default {
  getUsers: function(userData) {
    return new Promise((resolve, reject) => {
      axios
        .get("https://randomuser.me/api?results=30")
        .then(res => {
          const users = res.data;
          console.log(users)
          console.log("123" + users.results[0].name.first)
          const results = users.results.map(users => {
            console.log("this is a test")

            return {
              nameF: users.name.first,
              nameL: users.name.last,
              image: users.picture.thumbnail,
              email: users.email,
              GHusername: users.login.username




            };
          });
          resolve(userData);
        })
        .catch(err => reject(err));
    });

  },

  // Return a Promise to simulate an async call
  getUser: function(userData) {
    return new Promise(resolve => {
      resolve(userData);
    });
  }
};
